import { ADD_DIARY } from '../actions/types';

const diaries = [];

const diariesReducer = (diaries = [], action) => {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
           return [
            action.diary.data,
            ...diaries
           ]
        default:
            return diaries;
    }
}

export default diariesReducer;
